//services.js -> Services_Module
import React from 'react'

//internal_styles..
var styles=
{
    color:'white',
    backgroundColor:'purple'
}


//Services_Component
function Services() {

  
  //arrays
  var ourServices=['Designing','Development','Apps', 'Advertisement'];


  return(<React.Fragment>
            
          <h1>Services Component</h1>
          
          <p>
          Components are independent and reusable bits of code. They serve the same purpose as JavaScript functions, but work in isolation and return HTML via a render() function. Components come in two types, Class components and Function components, in this tutorial we will concentrate on Class components.
          </p>

          <p>
          JSX stands for JavaScript XML. JSX allows us to write HTML in React. JSX makes it easier to write and add HTML in React.
          </p>

              <ul>
                  <li key='0'> { ourServices[0] } </li>
                  <li key='1'> { ourServices[1] } </li>
                  <li key='2'> { ourServices[2] } </li>
                  <li key='3'> { ourServices[3] } </li>
              </ul>


              {
                ourServices.map( (arrayData,ArraydataIndex)=> arrayData )
              }

              <br />
              <br />
              
              <ul type="none">
                {
                  ourServices.map( (data,index)=> <li key={index}> {index+1}.{data}  </li> )
                }
              </ul>
       

      </React.Fragment>)
}


export default Services
